import styled from 'styled-components'

export const Wrapper = styled.div`
    font-family: Cambria, Cochin, Georgia, Times, 'Times New Roman', serif;
    display: flex;
    color : wheat;
   
   
`;
 export const Text = styled.div`
    display: flex;
    align-items: center;
   justify-content: center;
 `;
